DROP TABLE IF EXISTS `goods`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `goods` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '百货名称',
  `info` varchar(1000) DEFAULT NULL COMMENT '描述',
  `capacity` bigint(20) DEFAULT NULL COMMENT '容量',
  `lowest_price` float DEFAULT NULL COMMENT '最低价',
  `upload_type_id` bigint(20) DEFAULT NULL COMMENT '1-买手 2-寻安  3-商户',
  `norms_id` bigint(20) DEFAULT NULL COMMENT '规格id',
  `is_recommended` int(11) DEFAULT NULL COMMENT '1-推荐 0-不推荐',
  `price` float DEFAULT NULL COMMENT '实际价格',
  `adv_pic` bigint(20) DEFAULT NULL COMMENT '商品广告图',
  `price_currency_id` bigint(20) DEFAULT NULL COMMENT '货币种类id',
  `highest_price` float DEFAULT NULL COMMENT '最高价',
  `brand_id` bigint(20) DEFAULT NULL COMMENT '品牌id',
  `shelf_life` datetime DEFAULT NULL COMMENT '保质期',
  `color` varchar(10) DEFAULT NULL COMMENT '颜色',
  `purchasing_position` varchar(100) DEFAULT NULL COMMENT '采购位置',
  `date_of_production` datetime DEFAULT NULL COMMENT '生产日期',
  `bar_code` varchar(100) DEFAULT NULL COMMENT '条形码',
  `speed_awb` varchar(100) DEFAULT NULL COMMENT '速运单号',
  `goods_according_to_positive` bigint(20) DEFAULT NULL COMMENT '商品正视图',
  `left_photo` bigint(20) DEFAULT NULL COMMENT '商品左侧视图',
  `right_photo` bigint(20) DEFAULT NULL COMMENT '右侧视图',
  `goods_invoice` bigint(20) DEFAULT NULL COMMENT '商品发票',
  `express_single` bigint(20) DEFAULT NULL COMMENT '快递单',
  `classid` bigint(20) DEFAULT NULL COMMENT '分类id',
  `country_id` int(11) DEFAULT NULL COMMENT '国家id',
  `limit_count` int(11) DEFAULT NULL COMMENT '限购次数',
  `inventory` int(11) DEFAULT NULL COMMENT '库存',
  `state` int(11) DEFAULT NULL COMMENT '状态(1,未发货,2已发货)',
  `shelves` int(11) DEFAULT NULL COMMENT '是否上架: 1-是  0-否',
  `add_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `FK_Reference_38` (`adv_pic`),
  KEY `FK_Reference_42` (`upload_type_id`),
  KEY `FK_back_goods_according_to_fileid` (`left_photo`),
  KEY `FK_class_goods` (`classid`),
  KEY `FK_currencyid` (`price_currency_id`),
  KEY `FK_express_single_file` (`express_single`),
  KEY `FK_goodsAccording` (`goods_according_to_positive`),
  KEY `FK_goods_invoice_file` (`goods_invoice`),
  KEY `FK_norms_good` (`norms_id`),
  KEY `FK_product_profile_fileid` (`right_photo`),
  CONSTRAINT `FK_Reference_38` FOREIGN KEY (`adv_pic`) REFERENCES `file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_Reference_42` FOREIGN KEY (`upload_type_id`) REFERENCES `upload_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_back_goods_according_to_fileid` FOREIGN KEY (`left_photo`) REFERENCES `file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_class_goods` FOREIGN KEY (`classid`) REFERENCES `classification` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_currencyid` FOREIGN KEY (`price_currency_id`) REFERENCES `currency` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_express_single_file` FOREIGN KEY (`express_single`) REFERENCES `file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goodsAccording` FOREIGN KEY (`goods_according_to_positive`) REFERENCES `file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goods_invoice_file` FOREIGN KEY (`goods_invoice`) REFERENCES `file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_norms_good` FOREIGN KEY (`norms_id`) REFERENCES `norms` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_product_profile_fileid` FOREIGN KEY (`right_photo`) REFERENCES `file` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=82 DEFAULT CHARSET=utf8 COMMENT='商品';
